import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

function ExploreByArea() {
  return (
    <div>
      <Header title="Explorar Origem" isSearchable />
      <Footer />
    </div>
  );
}
export default ExploreByArea;
